    def selectAz(self):
        try:
            for call in self.tableWidget.selectedItems():
                adress = f'Ques/Azmoon/{call.text()}.tm'
                with open(adress) as do:
                    self.do = do.read()
                link = list(self.do.split('**\n'))
                if link[0] == 'Test':
                    from NamedProject_Testical import Ui_Dialog
                    uid = Ui_Dialog()
                    dia121 = QtWidgets.QDialog()
                    uid.setupUi(dia121)
                    dia121.setWindowTitle(call.text())
                    uid.map_str(link)
                    uid.Name.append(call.text())
                    uid.maps()
                    dia121.exec_()
                if link[0] == 'Anatomical':
                    from NamedProject_anatomical import Ui_Dialog
                    uid = Ui_Dialog()
                    dia122 = QtWidgets.QDialog()
                    uid.setupUi(dia122)
                    uid.Name.append(call.text())
                    uid.map_str(link)
                    uid.maps()
                    dia122.exec_()
                if link[0] == 'Guessy':
                    from NamedProject_Guessy import Ui_Dialog,Name
                    Name.clear()
                    Name.append(call.text())
                    uid = Ui_Dialog()
                    dia122 = QtWidgets.QDialog()
                    uid.setupUi(dia122)
                    
                    uid.map_str(link)
                    uid.maps()
                    dia122.exec_()
                    print('F/T')
        except:
                from Out import Ui_Dialog
                ding = Ui_Dialog()
                diadi = QtWidgets.QDialog()
                ding.setupUi(diadi)
                ding.label.setText(f"Erorr:no Azmoon")
                ding.pushButton.clicked.connect(lambda : diadi.close())
                diadi.exec_()
                return
    def AzPmax(self):
        with open('Uper/List Azmax.txt') as found:
            self.read = found.read()
        come = set(self.read.split('*%!'))
        print(come)
        come = list(come)
        ii = 0
        for i in come:
            if i != '':
                print(i ,' in ',come)
                it = self.tableWidget.item(ii,0)
                it.setText(i)
                ii += 1
        
